def Name():
    import random
    sogl=list("rtpsdfghkljzxcvbnmy")
    glas=list("euioa")
    s=""
    x=random.randint(3,8)
    s+=random.choice(sogl+glas)
    s+=random.choice(sogl+glas)
    for i in range(x-2):
        if s[-1] in sogl and s[-2] in sogl:
            s+=random.choice(glas)
        elif s[-1] in glas and s[-2] in glas:
            s+=random.choice(sogl)
        else:
            s+=random.choice(sogl+glas)
    return s+"-"+str(random.randint(1,1000))
def Multicolor(img,lava,ocean,shallow,plant,snow,sand,mountain,plain,ground):
    import random
    lava_n=[(207+x,16+x,32+x) for x in range(-20,20)]
    ocean_n=[(0,0,x) for x in range(128-20,128+20)]
    shallow_n=[(x,x,255) for x in range(20,60)]
    plant_n=[(93+x,161+x,48+x) for x in range(-20,20)]
    snow_n=[(x,x,x) for x in range(216,256)]
    sand_n=[(252+x,221+x,118+x) for x in range(-20,20)]
    if additive.get()==0:
        mountain_n=[(x,x,x) for x in range(50,90)]
        plain_n=[(x,x,x) for x in range(108,148)]
        ground_n=[(x,x,x) for x in range(160,200)]
    elif additive.get()==1:
        mountain_n=[(x,x,0) for x in range(100,140)]
        plain_n=[(x,x,0) for x in range(190,230)]
        ground_n=[(255,255,x) for x in range(60,100)]
    elif additive.get()==2:
        mountain_n=[(x,0,0) for x in range(100,140)]
        plain_n=[(x,35,35) for x in range(170,210)]
        ground_n=[(220,x,x) for x in range(70,110)]
    elif additive.get()==3:
        mountain_n=[(140+x,70+x,0) for x in range(1,40)]
        plain_n=[(200+x,100+x,0) for x in range(1,40)]
        ground_n=[(255,160+x,70+x) for x in range(1,40)]
    elif additive.get()==4:
        mountain_n=[(x,0,x) for x in range(100,140)]
        plain_n=[(x,0,x) for x in range(180,220)]
        ground_n=[(255,x,255) for x in range(90,130)]
    for i in range(118):
        for k in range(118):
            if img.getpixel((i,k))==lava:
                img.putpixel((i,k),random.choice(lava_n))
            elif img.getpixel((i,k))==ocean:
                img.putpixel((i,k),random.choice(ocean_n))
            elif img.getpixel((i,k))==shallow:
                img.putpixel((i,k),random.choice(shallow_n))
            elif img.getpixel((i,k))==plant:
                img.putpixel((i,k),random.choice(plant_n))
            elif img.getpixel((i,k))==snow:
                img.putpixel((i,k),random.choice(snow_n))
            elif img.getpixel((i,k))==sand:
                img.putpixel((i,k),random.choice(sand_n))
            elif img.getpixel((i,k))==mountain:
                img.putpixel((i,k),random.choice(mountain_n))
            elif img.getpixel((i,k))==plain:
                img.putpixel((i,k),random.choice(plain_n))
            elif img.getpixel((i,k))==ground:
                img.putpixel((i,k),random.choice(ground_n))
    return img
