def Shadow(x1,y1): #координаты пикселя
    import math
    a=x1-57 #координаты относительно центра картинки
    b=y1-58
    R=52    #радиус планеты
    xm=-24  #координаты точки максимальной освещенности (ТМО)
    zm=math.sqrt(R*R-xm*xm)
    z=math.sqrt(R*R-a*a-b*b) #координата точчки на поверхности планеты
    r=math.sqrt((a-xm)*(a-xm)+b*b+(z-zm)*(z-zm)) #расстояние до ТМО
    u=math.degrees(math.asin(r/2/R)) #угловое расстояние до ТМО
    k=(45-u)/45 #теневой коэффициент
    return k
