def Biom(img,b1,b2,b3,x1,x2):
    #img - планета
    #b1 - эти пиксели будут замещены
    #b2 - около этих пикселей будут новые
    #b3 - эти пиксели будут добавлены
    #x1 - циклы рисования
    #x2 - вероятность появления пикселя
    import random
    img_mas=[img]
    for c in range(x1):
        img_mas.append(0)
        img_mas[-1]=img_mas[-2].copy()
        for i in range(118):
            for k in range(118):
                if img_mas[-2].getpixel((i,k))==b1:
                    if img_mas[-2].getpixel((i+1,k)) in b2 or img_mas[-2].getpixel((i-1,k)) in b2 or img_mas[-2].getpixel((i,k-1)) in b2 or img_mas[-2].getpixel((i,k+1)) in b2:
                        if random.randint(1,100)<=x2*100:
                            img_mas[-1].putpixel((i,k),b3)
    return img_mas[-1]
